const defaultState = {
   username: '',
   password: ''
}

const loginReducer = (state=defaultState, action) => {
   switch(action.type) {
      case "UPDATED_LOGIN":
         return {
            username: action.signInData.username,
            password: action.signInData.password
         }
      case "RESETTED_LOGIN":
         return defaultState
      default:
         return state
   }
}

export default loginReducer
